export default (function(a,b,c,d,e,f,g,h){return {data:{c1Csk2zVk1:{data:{id:247,attributes:{imdbId:"tt0317132",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTA3NDYzNDE0MjBeQTJeQWpwZ15BbWU3MDc3NjA3MzM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"55%"},{Source:"Metacritic",Value:"54\u002F100"}],item_lang:{data:{id:910,attributes:{title:b,plot:"A girl named Opal move to a new home that is a trailer park. She has no friends and her dad is always doing something.Her dad told her to go to Winn Dixie to get some food. When she get there, something is going on. People were chasing something, then she see a dog. The dog was happy, he jumped on the manager, and the manager told his workers to call the pound. Opal did not want the dog to go to the pound, so she said the doog was hers. She named the dog Winn Dixie, the place where she found him. She goes home to ask her dad can she keep the dog. Opal dad lets her keep the dog she make a lot more friends that summer. She almost lost Winn Dixie in a thunderstorm at a party. Opal and Winn Dixie make friends with the kids at her church and old people smart and wise. Opal learns a lesson that you can't hold on to people who does not want to be held on to.",slug:"because-of-winn-dixie"}}},books:{data:[{id:2755,attributes:{title:b,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:c,subtitle:d}},{id:2756,attributes:{title:"Because of Winn-Dixie Anniversary Edition",description:"Revisit Kate DiCamillo’s beloved first novel with a beautiful twentieth-anniversary edition featuring an introduction by Ann Patchett. “This book is (I hope) a hymn of praise to dogs, friendship, and the South,” Kate DiCamillo said of her best-selling debut novel, which has been awarded a Newbery Honor, translated into nearly thirty languages, and turned into a major motion picture. The story of a preacher’s daughter named Opal whose life is transformed by a scruffy dog named Winn-Dixie continues to touch the hearts of readers of all ages. Celebrate twenty years of Because of Winn-Dixie with a signature anniversary edition featuring a redesigned cover, an introduction by PEN\u002FFaulkner Award–winning author Ann Patchett, and an afterword by Kate DiCamillo.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V6f-DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2020-12-01",publisher:c,subtitle:d}},{id:2757,attributes:{title:b,description:f,thumbnail:g,authors:[a],firstBook:e,published:h,publisher:c,subtitle:d}},{id:2758,attributes:{title:"The Essential Kate DiCamillo Collection",description:"For both Kate DiCamillo’s staunchest fans and those just discovering this beloved author, here are five of her award-winning classics in one handsome set. Create an instant Kate DiCamillo collection with five of her New York Times best-selling novels — among them a Newbery Honor Book, a National Book Award Finalist, a Newbery Medal Winner, a Boston Globe–Horn Book Award Winner, and an American Library Association Notable Children’s Book. Included in this set are editions of: Because of Winn-Dixie The Tiger Rising The Tale of Despereaux The Miraculous Journey of Edward Tulane The Magician’s Elephant",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VeJIAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2013-11-12",publisher:c,subtitle:d}},{id:2759,attributes:{title:b,description:"The perfect companion to Kate Dicamillo’s \"Because of Winn-Dixie,\" this study guide contains a chapter by chapter analysis of the book, a summary of the plot, and a guide to major characters and themes. BookCap Study Guides do not contain text from the actual book, and are not meant to be purchased as alternatives to reading the book. We all need refreshers every now and then. Whether you are a student trying to cram for that big final, or someone just trying to understand a book more, BookCaps can help. We are a small, but growing company, and are adding titles every month.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=92OxQU5MMQoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["BookCaps",a],firstBook:e,published:"2012-01-01",publisher:"BookCaps Study Guides",subtitle:"BookCaps Study Guide"}}]}}},meta:{}}},prerenderedAt:1680940920916}}("Kate DiCamillo","Because of Winn-Dixie","Candlewick Press","",null,"A classic tale by Newbery Medalist Kate DiCamillo, America's beloved storyteller. One summer’s day, ten-year-old India Opal Buloni goes down to the local supermarket for some groceries – and comes home with a dog. But Winn-Dixie is no ordinary dog. It’s because of Winn-Dixie that Opal begins to make friends. And it’s because of Winn-Dixie that she finally dares to ask her father about her mother, who left when Opal was three. In fact, as Opal admits, just about everything that happens that summer is because of Winn-Dixie. Featuring a new cover illustration by E. B. Lewis and an excerpt of Kate DiCamillo's newest novel, Raymie Nightingale.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ddRIAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2009-09-08"))